import DiningHall from "./DiningHall/DiningHall.js";
import "./App.css";
import { useEffect, useState } from 'react';
import { Spinner } from "react-bootstrap";

function App() {
    const [locations, setLocations] = useState([]);

    useEffect(() => {

        fetch('/data/getMenu')
            .then((res) => res.json())
            .then((data) => {
                const locs = data.map((el) => {
                    return el.Location
                }).sort()
                setLocations(locs)
            });
    }, [])

    return(
        <div className="mobile-box">
            {
                locations.length === 0 ? <Spinner className="align-middle spinner" animation="border" role="status"/> : <DiningHall locations={locations}/>
            }
        </div>
    )
}

export default App;
